import axios from 'axios';
import React, { Component } from 'react';

class Profile extends Component {
    state = {
        post:[],
        success:''
    }
    componentDidMount(){
        axios.get('/rtqkaq2345akdker24/')
        .then(response =>{
            console.log(response)
            this.setState({
                post:response.data
            })
        })
        .catch(errors =>{
            this.setState({
                success:'Something went wrong!!'
            })
        })
    }
    render() { 
        console.log(this.state.post)
        return ( 
                <div className='container'>
                       <p>Name:{this.state.post.data.first_name}</p>
                       <p>Surname:{this.state.post.data.last_name}</p>
                       <p>Username:{this.state.post.data.username}</p>
                       <p>Email:{this.state.post.data.email}</p>
                </div>
                );
    }
}
 
export default Profile;
